import react from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import {Container,Row ,Col} from 'react-bootstrap/Container' ; 
const Bootstrap = () =>{

    return(
        <>
  <Container>  
    <Row>  
     <Col className="bg-primary p-2">1 of 3</Col>  
     <Col className="bg-secondary p-2" md={6}>2 of 3 (wider)</Col>  
     <Col className="bg-danger p-2">3 of 3</Col>  
    </Row>  
  <Row>  
    <Col className="bg-success p-2">1 of 3</Col>  
    <Col className="bg-warning p-2" md={5}>2 of 3 (wider)</Col>  
    <Col className="bg-info p-2">3 of 3</Col>  
  </Row>  
</Container>  




            
        </>
    );
}; 

export default Bootstrap;
